import { backendAPI } from '@instinct-web/core';
export class GuideServiceImplementation {
  async getAll() {
    const guides = await backendAPI.get('guides');
    return guides.data;
  }

  async getByID(guideID) {
    const guide = await backendAPI.get(`guides/${guideID}`);
    return guide.data;
  }

  async create(guideDTO) {
    const newGuide = await backendAPI.post('guides', guideDTO);
    return newGuide.data;
  }

  async updateByID(guideID, guideDTO) {
    await backendAPI.patch(`guides/${guideID}`, guideDTO);
  }

  async deleteByID(guideID) {
    await backendAPI.delete(`guides/${guideID}`);
  }

}
